import "./Home.css";
const Home = () => {
  return (
    <>
      <img
        className="back"
        style={{ width: "100vw" }}
        src="./images/poster-min.jpg"
        alt=""
      />
      <div className="back-text"></div>
    </>
  );
};

export default Home;
